"4147":{"id":"4147","name":"Estrada para Perdição","slug":"estrada-para-perdicao","original_title":"Road to Perdition","overview":"Ele não deveria estar lá. Mas no momento em que Michael Sullivan Jr. presencia um brutal assassinato, as vidas desse menino de 12 anos e do gangster que é seu pai são destruídas para sempre e seus destinos unidos para sempre. Agora, perseguido pela Máfia a quem devotou sua vida, Sullivan e seu filho não têm para onde fugir ou como escapar à perseguição incansável de um sádico assassino. É nessa luta feroz e instintiva pela sobrevivência e para proteger seu filho, que este gangster profissional irá descobrir a honra e a redenção.","first_air_date":"2002-07-12","runtime":117,"episode_run_time":[117],"vote_average":7.4,"created_by":["DreamWorks Pictures","20th Century Fox","The Zanuck Company"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"20th Century Fox"},{"name":"The Zanuck Company"}],"cast":["Tom Hanks","Tyler Hoechlin","Paul Newman","Jude Law","Daniel Craig"],"backdrop_path":"https://image.tmdb.org/t/p/original/cDDyZ2qtBzNAepdTbgxKfFcxREl.jpg","poster_path":"https://image.tmdb.org/t/p/original/fLgZVSWTs9OSogL2nemPft8Oyy.jpg","certification":"16","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
"1646":{"id":"1646","name":"Escritores da Liberdade","slug":"escritores-da-liberdade","original_title":"Freedom Writers","overview":"Uma jovem e idealista professora chega a uma escola de um bairro pobre, que está corrompida pela agressividade e violência. Os alunos se mostram rebeldes e sem vontade de aprender, e há entre eles uma constante tensão racial. Assim, para fazer com que os alunos aprendam e também falem mais de suas complicadas vidas, a professora Gruwell aposta em métodos diferentes de ensino. Aos poucos, os alunos vão retomando a confiança em si mesmos, aceitando mais o conhecimento e reconhecendo valores.","first_air_date":"2007-01-05","runtime":123,"episode_run_time":[123],"vote_average":7.9,"created_by":["Double Feature Films","Jersey Films","Kernos Filmproduktionsgesellschaft & Company"],"production_companies":[{"name":"Double Feature Films"},{"name":"Jersey Films"},{"name":"Kernos Filmproduktionsgesellschaft & Company"}],"cast":["Hilary Swank","Patrick Dempsey","Scott Glenn","Imelda Staunton","April Hernandez Castillo"],"backdrop_path":"https://image.tmdb.org/t/p/original/oVCyqxwLkRPJC51w89Dwp6VL9vk.jpg","poster_path":"https://image.tmdb.org/t/p/original/2hyEEPT57d0rkXYmCH7vm5rKhKH.jpg","certification":"12","genres":["Crime","Drama"],"trailer":"N/A"},
