"9986":{"id":"9986","name":"A Menina e o Porquinho","slug":"a-menina-e-o-porquinho","original_title":"Charlotte's Web","overview":"A clássica história de lealdade, confiança e sacrifício ganha vida nesta adaptação de A Menina e o Porquinho. Fern (Dakota Fanning) logo percebe que Wilbur é um animal especial, e vai criando o menor porquinho do chiqueiro para virar um fantástico e radiante porco. Quando vai para um novo celeiro, Wilbur começa outra amizade profunda com a mais improvável das criaturas - uma aranha chamada Charlotte - e a ligação dos dois inspira os outros animais ao redor deles a se unirem como uma família. Quando se espalha a notícia de que os dias de Wilbur estão contados, parece que só um milagre poderá salvar sua vida. Uma decidida Charlotte - que enxerga milagres nos lugares mais comuns - tece palavras em sua teia, num esforço para convencer o fazendeiro de que Wilbur é o porco e que vale a pena poupá-lo.","first_air_date":"2006-12-07","runtime":94,"episode_run_time":[94],"vote_average":6.2,"created_by":["Paramount Pictures","Kerner Entertainment Company","Nickelodeon Movies"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Kerner Entertainment Company"},{"name":"Nickelodeon Movies"}],"cast":["Dakota Fanning","Julia Roberts","Steve Buscemi","John Cleese","Oprah Winfrey"],"backdrop_path":"https://image.tmdb.org/t/p/original/x7B2zT2OL8fKM53Wgzqz6nc7r02.jpg","poster_path":"https://image.tmdb.org/t/p/original/5c8JKbiVLWLKMCNior7bfijRYry.jpg","certification":"N/A","genres":["Comédia","Família","Fantasia"],"trailer":"N/A"},
