"680531":{"id":"680531","name":"O Baile das Loucas","slug":"o-baile-das-loucas","original_title":"Le Bal des folles","overview":"Eugénie tem um dom: ela ouve e vê os mortos. Quando sua família descobre este segredo, no fim do século XIX, seu pai e seu irmão a internam na clínica neurológica La Pitié Salpêtrière, sem chance de escapar. Seu destino se entrelaça com o de Geneviève, enfermeira da clínica. O encontro muda o futuro das duas, enquanto se preparam para o \"Baile das Loucas\", evento anual organizado pelo Dr. Charcot.","first_air_date":"2021-09-12","runtime":121,"episode_run_time":[121],"vote_average":7.1,"created_by":["Légende Films"],"production_companies":[{"name":"Légende Films"}],"cast":["Lou de Laâge","Mélanie Laurent","Emmanuelle Bercot","Benjamin Voisin","Cédric Kahn"],"backdrop_path":"https://image.tmdb.org/t/p/original/26aZuA5I52lTJlvpRaJtz1TcgU0.jpg","poster_path":"https://image.tmdb.org/t/p/original/a2PmxoTMHlqiSzqmKFef69htswW.jpg","certification":"16","genres":["Thriller","Drama","História"],"trailer":"N/A"},
