"7446":{"id":"7446","name":"Trovão Tropical","slug":"trovao-tropical","original_title":"Tropic Thunder","overview":"Tugg Speedman (Ben Stiller), Kirk Lazarus (Robert Downey Jr.) e Jeff Portnoy (Jack Black) são grandes astros de Hollywood, que acertaram suas presenças em \"Trovão Tropical\", novo filme do diretor inglês Damien Cockburn (Steve Coogan). O projeto é a adaptação da biografia de \"4 Folhas\" Tayback (Nick Nolte), um veterano da Guerra do Vietnã. A equipe vai ao próprio Vietnã para realizar as filmagens, mas logo o ego dos atores principais causa problemas. Tentando controlar o trio, Damien decide rodar as cenas em plena floresta, sem imaginar os perigos que sua decisão traria.","first_air_date":"2008-08-09","runtime":107,"episode_run_time":[107],"vote_average":6.7,"created_by":["DreamWorks Pictures","Red Hour","Goldcrest","Internationale Filmproduktion Stella-del-Süd"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"Red Hour"},{"name":"Goldcrest"},{"name":"Internationale Filmproduktion Stella-del-Süd"}],"cast":["Ben Stiller","Robert Downey Jr.","Jack Black","Jay Baruchel","Brandon T. Jackson"],"backdrop_path":"https://image.tmdb.org/t/p/original/4pLi4QMm0MZ9TSoF3l8qQmY9HNO.jpg","poster_path":"https://image.tmdb.org/t/p/original/wy7GVLCGTmOgbGvIMChVMNOMNao.jpg","certification":"16","genres":["Ação","Comédia","Aventura","Guerra"],"trailer":"N/A"},
