"1700":{"id":"1700","name":"Louca Obsessão","slug":"louca-obsessao","original_title":"Misery","overview":"Depois de terminar seu mais novo manuscrito, o escritor de sucesso, Paul Sheldon, decide sair para comemorar. O problema é que está nevando demais e Paul acaba sofrendo um terrível acidente. Ele é salvo e abrigado por uma ex-enfermeira chamada Annie Wilkes, que se auto-intitula sua fã número um. Aparentemente uma simpática e doce senhora, Annie, aos poucos, vai se revelando uma sádica psicótica, que começa a torturar Paul quando descobre que ele matou sua personagem favorita em seu último livro publicado. Agora, Paul Sheldon terá de usar suas artimanhas de escritor para ganhar tempo, enganar Annie e, com sorte, escapar deste pesadelo.","first_air_date":"1990-11-30","runtime":107,"episode_run_time":[107],"vote_average":7.8,"created_by":["Castle Rock Entertainment","Nelson Entertainment","Columbia Pictures"],"production_companies":[{"name":"Castle Rock Entertainment"},{"name":"Nelson Entertainment"},{"name":"Columbia Pictures"}],"cast":["James Caan","Kathy Bates","Richard Farnsworth","Frances Sternhagen","Lauren Bacall"],"backdrop_path":"https://image.tmdb.org/t/p/original/rUAn3Ul1tL7JXMjZ951UOI3F0UA.jpg","poster_path":"https://image.tmdb.org/t/p/original/uOqA7w49sMfmXpkQXnDuDJRGFx4.jpg","certification":"14","genres":["Drama","Thriller"],"trailer":"VESCIlSfsVM"},
