"9407":{"id":"9407","name":"Justiça Vermelha","slug":"justica-vermelha","original_title":"Red Corner","overview":"Jack Moore um advogado americano (Richard Gere),viaja para a China representando uma companhia dos EUA que pretende fazer um acordo para TV via satélite. Ele tem um caso de uma noite com uma jovem chinesa e acorda de manhã ao lado de um cadáver cercado por evidências de que ele assassinou a mulher. Ele consegue convencer seu advogado, Shen Yuelin (Bai Ling), de que ele não é culpado, e juntos eles descobrem evidências de uma trama na qual o alvo é Moore.","first_air_date":"1997-10-30","runtime":123,"episode_run_time":[123],"vote_average":6.3,"created_by":["Avnet/Kerner Productions","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Avnet/Kerner Productions"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Richard Gere","Bai Ling","Bradley Whitford","Byron Mann","Peter Donat"],"backdrop_path":"https://image.tmdb.org/t/p/original/lCczq2kw7PzHgwpwGfuXAK946lm.jpg","poster_path":"https://image.tmdb.org/t/p/original/7jtoCR2yEmjS4IgDUvfYT3r5sZg.jpg","certification":"12","genres":["Crime","Drama","Thriller"],"trailer":"Ng9KGLbGaBA"},
