"869":{"id":"869","name":"Planeta dos Macacos","slug":"planeta-dos-macacos","original_title":"Planet of the Apes","overview":"Após sofrer um acidente na espaçonave em que estava, Leo Davidson chega em um planeta estranho e primitivo, onde os humanos migalham por sua subsistência, são caçados e escravizados por primatas tiranos, que formam o poder local. Sem concordar com a opressão imposta à raça humana, Leo logo se torna uma séria ameaça ao status quo local e dá início à uma revolução social no planeta.","first_air_date":"2001-07-25","runtime":119,"episode_run_time":[119],"vote_average":5.8,"created_by":["20th Century Fox","The Zanuck Company"],"production_companies":[{"name":"20th Century Fox"},{"name":"The Zanuck Company"}],"cast":["Mark Wahlberg","Tim Roth","Helena Bonham Carter","Michael Clarke Duncan","Kris Kristofferson"],"backdrop_path":"https://image.tmdb.org/t/p/original/1N0MYYFvYwpM5fi3mjw4150ReoR.jpg","poster_path":"https://image.tmdb.org/t/p/original/qmv5Q5rjbO2wMveB1UC31prOCKH.jpg","certification":"12","genres":["Thriller","Ficção científica","Ação","Aventura"],"trailer":"N/A"},
"8009":{"id":"8009","name":"Highlander: O Guerreiro Imortal","slug":"highlander-o-guerreiro-imortal","original_title":"Highlander","overview":"Connor MacLeod, um guerreiro escocês do século XVI, imortal e, após algum tempo, encontra Juan Ramirez, imortal como ele. Ramirez o ensina a manejar uma espada, pois a única forma de matar um imortal é cortando sua cabeça. Após alguns séculos, surge um inimigo, imortal como ambos, que pretende decapitar Connor, para se tornar o único imortal da face da Terra.","first_air_date":"1986-03-07","runtime":116,"episode_run_time":[116],"vote_average":6.9,"created_by":["Davis-Panzer Productions","Thorn EMI Screen Entertainment","Highlander Productions Limited"],"production_companies":[{"name":"Davis-Panzer Productions"},{"name":"Thorn EMI Screen Entertainment"},{"name":"Highlander Productions Limited"}],"cast":["Christopher Lambert","Roxanne Hart","Clancy Brown","Sean Connery","Beatie Edney"],"backdrop_path":"https://image.tmdb.org/t/p/original/1S7uCBV4rvQR24kh0TldWhjLV3F.jpg","poster_path":"https://image.tmdb.org/t/p/original/74PP2NUjqjJi9QzHNjQlg1jUOdY.jpg","certification":"14","genres":["Aventura","Ação","Fantasia"],"trailer":"N/A"},
