"10781":{"id":"10781","name":"O Massacre da Serra Elétrica: O Início","slug":"o-massacre-da-serra-eletrica-o-inicio","original_title":"The Texas Chainsaw Massacre: The Beginning","overview":"Como numa espécie de terrível premonição, o jovem Thomas Hewitt nasce em parto complicado no chão de um abatedouro no Texas. Depois de um nascimento brutal, ele acaba resgatado pela bizarra Luda Mae e passa a ser criado por uma estranha família formada por personagens como o Xerife Hoyt, Montgomery e Henrietta. Tommy começa então uma vida violenta, repleta de abusos físicos e emocionais, que logo vão alimentar a sua sede de sangue e transformá-lo no mortal Leatherface da série \"O Massacre da Serra Elétrica.\" Conheça a história que deu origem a um dos maiores assassinos da história do cinema, quando um grupo de jovens sai acidentalmente de seu caminho e se aproxima da casa de horrores que os transformaria nas primeiras vítimas de Leatherface. O massacre vai começar!","first_air_date":"2006-10-05","runtime":91,"episode_run_time":[91],"vote_average":6.1,"created_by":["Texas Chainsaw Productions","New Line Cinema","Next Entertainment","Platinum Dunes","Vortex/Henkel/Hooper"],"production_companies":[{"name":"Texas Chainsaw Productions"},{"name":"New Line Cinema"},{"name":"Next Entertainment"},{"name":"Platinum Dunes"},{"name":"Vortex/Henkel/Hooper"}],"cast":["Jordana Brewster","Taylor Handley","Diora Baird","Matt Bomer","R. Lee Ermey"],"backdrop_path":"https://image.tmdb.org/t/p/original/bkuCWDEVAp97j7XHftziO9ROYDu.jpg","poster_path":"https://image.tmdb.org/t/p/original/a6oqQberLAI2KWkYEz6c4gP2nIk.jpg","certification":"18","genres":["Terror"],"trailer":"rWTfIAe-sKw"},
"19959":{"id":"19959","name":"Substitutos","slug":"substitutos","original_title":"Surrogates","overview":"O agente do FBI Tom Greer vive em um mundo onde robôs tomam o lugar das pessoas, protegendo-as da violência. Estes humanóides, aparentemente perfeitos e reais, possibilitam à população experimentar comodidade e segurança. Greer e a sua parceira Peters são chamados para investigar a morte de um estudante universitário, cujo substituto é destruído. Em um mundo de máscaras, Greer tem que decidir quem é real e em quem pode confiar, arriscando a sua própria vida para resolver o caso.","first_air_date":"2009-09-24","runtime":89,"episode_run_time":[89],"vote_average":6.1,"created_by":["Wintergreen Productions","Touchstone Pictures","Mandeville Films","Top Shelf Productions"],"production_companies":[{"name":"Wintergreen Productions"},{"name":"Touchstone Pictures"},{"name":"Mandeville Films"},{"name":"Top Shelf Productions"}],"cast":["Bruce Willis","Radha Mitchell","Rosamund Pike","James Cromwell","Ving Rhames"],"backdrop_path":"https://image.tmdb.org/t/p/original/cCjzu6OZIUDWowadzexCHNBTmjH.jpg","poster_path":"https://image.tmdb.org/t/p/original/7XFVhr1GcDTs4BYVbQrK07oVSa6.jpg","certification":"14","genres":["Ficção científica","Ação","Thriller"],"trailer":"N/A"},
