"257445":{"id":"257445","name":"Goosebumps: Monstros e Arrepios","slug":"goosebumps-monstros-e-arrepios","original_title":"Goosebumps","overview":"O jovem Zach Cooper se muda de Nova York para uma cidade pequena dos Estados Unidos, para onde a mãe é transferida. Lá, eles passam a morar na casa ao lado da de Hannah por quem o adolescente se apaixona e o pai, o ranzinza R. L. Stine. Depois de escutar gritos vindo da propriedade ao lado, Zach invade a residência com a ajuda do medroso colega e acaba, acidentalmente, abrindo um dos livros e, consequentemente, dando início à libertação de todos os monstros criados por Stine. Juntos, eles terão que mandar as criaturas de volta para as prateleiras.","first_air_date":"2015-08-05","runtime":103,"episode_run_time":[103],"vote_average":6.3,"created_by":["Original Film","Scholastic Entertainment","Columbia Pictures","Village Roadshow Pictures","Sony Pictures Animation"],"production_companies":[{"name":"Original Film"},{"name":"Scholastic Entertainment"},{"name":"Columbia Pictures"},{"name":"Village Roadshow Pictures"},{"name":"Sony Pictures Animation"}],"cast":["Jack Black","Dylan Minnette","Odeya Rush","Amy Ryan","Ryan Lee"],"backdrop_path":"https://image.tmdb.org/t/p/original/lHnLmg16r6VvMV7cKpFxjwdG8m2.jpg","poster_path":"https://image.tmdb.org/t/p/original/d1rkpUr64IY0ARTyWU6MrHJD2Wt.jpg","certification":"10","genres":["Aventura","Terror","Comédia"],"trailer":"IKyiFa9qef0"},
"9560":{"id":"9560","name":"Caminhando nas Nuvens","slug":"caminhando-nas-nuvens","original_title":"A Walk in the Clouds","overview":"Logo após a rendição do Japão, que marca o fim da II Guerra Mundial. Paul Sutton retorna a São Francisco para se reunir com sua esposa Betty, com quem se casou, na sequência de um namoro rápido, um dia antes de ele partiu para o Pacífico. A guerra deixou com cicatrizes emocionais. Paulo briga com Betty, especialmente depois que ele descobre que a maioria das cartas que ele escreveu-lhe ela não abriu. Ele está determinado a deixar o casamento, e espera estabelecer uma nova carreira. Numa de suas viagens como vendedor de chocolate, Paul, conhece Victoria, uma bela estudante grávida. Emocionado pela sua história, ele concorda em passar por seu marido até que sua família se acostume com a ideia.","first_air_date":"1995-05-27","runtime":102,"episode_run_time":[102],"vote_average":7.3,"created_by":["Zucker Brothers Productions","20th Century Fox"],"production_companies":[{"name":"Zucker Brothers Productions"},{"name":"20th Century Fox"}],"cast":["Keanu Reeves","Aitana Sánchez-Gijón","Anthony Quinn","Angélica Aragón","Evangelina Elizondo"],"backdrop_path":"https://image.tmdb.org/t/p/original/wLuIBZ7JHRuyPpJSUXDqBdYGJEK.jpg","poster_path":"https://image.tmdb.org/t/p/original/zDNXGaCWqlJ5OGEsVzmpRX29uT5.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"N/A"},
