"97020":{"id":"97020","name":"RoboCop","slug":"robocop","original_title":"RoboCop","overview":"Em um futuro não muito distante, no ano de 2028, drones não tripulados e robôs são usados para garantir a segurança mundo afora, mas o combate ao crime nos Estados Unidos não pode ser realizado por eles e a empresa OmniCorp, criadora das máquinas, quer reverter esse cenário. Uma das razões para a proibição seria uma lei apoiada pela maioria dos americanos. Querendo conquistar a população, o dono da companhia Raymond Sellars (Michael Keaton) decide criar um robô que tenha consciência humana e a oportunidade aparece quando o policial Alex Murphy (Joel Kinnaman) sofre um atentado, deixando-o entre a vida e a morte.","first_air_date":"2014-01-30","runtime":118,"episode_run_time":[118],"vote_average":5.9,"created_by":["Metro-Goldwyn-Mayer","Columbia Pictures","Strike Entertainment"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"},{"name":"Columbia Pictures"},{"name":"Strike Entertainment"}],"cast":["Joel Kinnaman","Gary Oldman","Michael Keaton","Abbie Cornish","Jackie Earle Haley"],"backdrop_path":"https://image.tmdb.org/t/p/original/xACuC5FwpCdayrcCsJPxYzrl8BO.jpg","poster_path":"https://image.tmdb.org/t/p/original/7vFsWZGc2ciJVt888FbeKBKWv16.jpg","certification":"14","genres":["Ficção científica","Ação","Crime"],"trailer":"N/A"},
