"207768":{"id":"207768","name":"Doce Vingança 2","slug":"doce-vinganca-2","original_title":"I Spit on Your Grave 2","overview":"A jovem e bela Katie (Jemma Dallender) sonha em conseguir seguir a carreira de modelo em Nova York. Sem dinheiro para pagar uma sessão com um fotográfo profissional, ela vê um anúncio de um homem que tira fotos de graça. Mas a inocente sessão acaba culminando na jovem sendo estuprada, humilhada, drogada e sequestrada. Ela acorda em outro país, mas, ao tentar escapar, é enterrada viva. Apesar de todas as propabilidades contra ela, a jovem sobrevive. E agora, Katie vai buscar uma brutal vingança contra aqueles que tanto a machucaram.","first_air_date":"2013-08-25","runtime":106,"episode_run_time":[106],"vote_average":6.3,"created_by":["CineTel Films"],"production_companies":[{"name":"CineTel Films"}],"cast":["Jemma Dallender","Joe Absolom","Aleksandar Aleksiev","Yavor Baharov","Mary Stockley"],"backdrop_path":"https://image.tmdb.org/t/p/original/rmYAHOJoA55EKP2t4WQAntPTjMY.jpg","poster_path":"https://image.tmdb.org/t/p/original/qnU2jXAL4YWP0d7hnrp8xTyz1P4.jpg","certification":"18","genres":["Thriller","Terror","Crime"],"trailer":"N/A"},
