"8810":{"id":"8810","name":"Mad Max 2: A Caçada Continua","slug":"mad-max-2-a-cacada-continua","original_title":"Mad Max 2","overview":"No futuro o bem mais precioso é a gasolina, em virtude de uma guerra que acabou com os campos petrolíferos do Oriente Médio. Tendo combustível pode-se fugir da morte ou se dirigir a algum lugar para matar alguém. Neste contexto, Max resolve ajudar uma comunidade a defender sua refinaria contra uma gangue de motoqueiros.","first_air_date":"1981-12-24","runtime":95,"episode_run_time":[95],"vote_average":7.4,"created_by":["Kennedy Miller Productions"],"production_companies":[{"name":"Kennedy Miller Productions"}],"cast":["Mel Gibson","Bruce Spence","Michael Preston","Max Phipps","Vernon Wells"],"backdrop_path":"https://image.tmdb.org/t/p/original/jEuwsmFS8JPzkDIhRL3B2BVYbU4.jpg","poster_path":"https://image.tmdb.org/t/p/original/7E38R1NjCCNACzAqElEm9tg6UIk.jpg","certification":"16","genres":["Aventura","Ação","Thriller","Ficção científica"],"trailer":"N/A"},
"7347":{"id":"7347","name":"Tropa de Elite","slug":"tropa-de-elite","original_title":"Tropa de Elite","overview":"Rio de Janeiro, 1997. Nascimento, capitão da Tropa de Elite do Rio de Janeiro, é designado para chefiar uma das equipes que tem como missão \"apaziguar\" o Morro do Turano por um motivo que ele considera insensato. Mas ele tem que cumprir as ordens enquanto procura por um substituto. Sua mulher, Rosane, está no final da gravidez e todos os dias lhe pede para sair da linha de frente do batalhão. Pressionado, o capitão sente os efeitos do estresse.Neste clima, é chamado para mais uma emergência num morro. Em meio a um tiroteio em um baile funk, Nascimento e sua equipe têm que resgatar dois aspirantes a oficiais da PM: Neto e Matias. Ansiosos por entrar em ação e impressionados com a eficiência de seus salvadores, os dois se candidatam ao curso de formação da Tropa de Elite.","first_air_date":"2007-10-12","runtime":115,"episode_run_time":[115],"vote_average":8.0,"created_by":["Universal Pictures do Brasil","The Weinstein Company","Zazen Produções","Estúdios Mega","Quanta Centro de Produções Cinematográficas","Costa Films","Posto 9","Feijão Filmes"],"production_companies":[{"name":"Universal Pictures do Brasil"},{"name":"The Weinstein Company"},{"name":"Zazen Produções"},{"name":"Estúdios Mega"},{"name":"Quanta Centro de Produções Cinematográficas"},{"name":"Costa Films"},{"name":"Posto 9"},{"name":"Feijão Filmes"}],"cast":["Wagner Moura","André Ramiro","Caio Junqueira","Milhem Cortaz","Fernanda Machado"],"backdrop_path":"https://image.tmdb.org/t/p/original/4cHmKn3eG7KIpi7ipAU4KHSmpXc.jpg","poster_path":"https://image.tmdb.org/t/p/original/atl4a9VFVP7JYvk4GeSgqhLOfjC.jpg","certification":"16","genres":["Drama","Ação","Crime"],"trailer":"uZBiNJQxtGw"},
"2046":{"id":"2046","name":"O Dom da Premonição","slug":"o-dom-da-premonicao","original_title":"The Gift","overview":"Annie Wilson, uma jovem viúva e mãe de três filhos, ganha a vida prevendo o futuro de outras pessoas, embora o seu próprio futuro tenha se tornado mais nebuloso do que ela pode ver. Ameaçada pelo marido violento de uma cliente e atormentada por visões de uma mulher local desaparecida, Annie se vê envolvida em um emaranhado de mentiras e enganos, no qual seu extraordinário dom pode acabar levando-a à morte.","first_air_date":"2000-03-16","runtime":112,"episode_run_time":[112],"vote_average":6.4,"created_by":["Lakeshore Entertainment","Alphaville Films","Paramount Classics"],"production_companies":[{"name":"Lakeshore Entertainment"},{"name":"Alphaville Films"},{"name":"Paramount Classics"}],"cast":["Cate Blanchett","Giovanni Ribisi","Keanu Reeves","Katie Holmes","Greg Kinnear"],"backdrop_path":"https://image.tmdb.org/t/p/original/tUmAtUBBTUqOxn0Fggv6uxKyhs2.jpg","poster_path":"https://image.tmdb.org/t/p/original/h59Go2QUP2duv6vd6f8IiZ8okSt.jpg","certification":"N/A","genres":["Terror","Drama","Thriller","Mistério"],"trailer":"N/A"},
"11674":{"id":"11674","name":"101 Dálmatas","slug":"101-dalmatas","original_title":"101 Dalmatians","overview":"A designer de moda Anita e o programador de jogos para computador Roger se encontram, se apaixonam e se casam junto com seus dálmatas Perdita e Pongo. Mas os filhotinhos dos orgulhosos Perdita e Pongo são sequestrados pela chefe de Anita, a Cruella De Vil, que está roubando filhotes de dálmatas para fazer o casaco de peles que ela definiu como seu preferido. Com a ajuda do reino animal britânico, Pongo e Perdita partem para encontrar e resgatar seus filhotes de seus temíveis sequestradores, Jasper e Horácio. Acabam encontrando alguns mais.","first_air_date":"1996-11-27","runtime":103,"episode_run_time":[103],"vote_average":5.9,"created_by":["Great Oaks Entertainment","Walt Disney Pictures","Wizzer Productions"],"production_companies":[{"name":"Great Oaks Entertainment"},{"name":"Walt Disney Pictures"},{"name":"Wizzer Productions"}],"cast":["Glenn Close","Jeff Daniels","Joely Richardson","Joan Plowright","Hugh Laurie"],"backdrop_path":"https://image.tmdb.org/t/p/original/yqh3mb9jd3GTTs09ZlnW4mxS95z.jpg","poster_path":"https://image.tmdb.org/t/p/original/wUgVfahHvlz8AIwJoNUAaFDtb7O.jpg","certification":"L","genres":["Família","Comédia"],"trailer":"N/A"},
"13387":{"id":"13387","name":"Carga Explosiva 3","slug":"carga-explosiva-3","original_title":"Transporter 3","overview":"Frank Martin é obrigado a conduzir Valentina, a filha de Leonid Vasilev, o chefe da Agência de Proteção Ambiental da Ucrânia. Ela foi sequestrada por Jonas Johnson, contratado por uma empresa de gerenciamento internacional de resíduos que deseja operar na Ucrânia. Para ter Frank e Valentina sob controle, Jonas prende em seus pulsos um dispositivo que determina que não possam se afastar muito do carro que os conduz, caso contrário o bracelete explode. Contando com a ajuda do inspetor Tarconi, Frank busca um meio de deixar a armadilha.","first_air_date":"2008-11-26","runtime":104,"episode_run_time":[104],"vote_average":6.1,"created_by":["Grive Productions","EuropaCorp","TF1 Films Production","Quinta Communications","Current Entertainment","Canal+","Apipoulaï Productions","Lionsgate"],"production_companies":[{"name":"Grive Productions"},{"name":"EuropaCorp"},{"name":"TF1 Films Production"},{"name":"Quinta Communications"},{"name":"Current Entertainment"},{"name":"Canal+"},{"name":"Apipoulaï Productions"},{"name":"Lionsgate"}],"cast":["Jason Statham","Natalya Rudakova","François Berléand","Robert Knepper","Jeroen Krabbé"],"backdrop_path":"https://image.tmdb.org/t/p/original/nNbxrSyKUTMVwpnFgnKH9ZV0QZ8.jpg","poster_path":"https://image.tmdb.org/t/p/original/t6ayrfuhmKl6VUOByP7RJL047X1.jpg","certification":"16","genres":["Ação","Thriller","Crime"],"trailer":"N/A"},
