"14199":{"id":"14199","name":"As Aventuras de Sharkboy e Lavagirl","slug":"as-aventuras-de-sharkboy-e-lavagirl","original_title":"The Adventures of Sharkboy and Lavagirl","overview":"Max (Cayden Boyd) é um solitário garoto de 10 anos, que se perde em seu próprio mundo de fantasia para escapar das confusões diárias decorrentes do contato com seus pais, dos valentões da escola e de férias de verão nem um pouco divertidas. Porém quando Max descobre que os super-heróis que existem em sua imaginação podem ser bem mais reais do que ele imaginava, seu mundo se transforma completamente. Max parte em uma viagem interplanetária rumo ao planeta Baba, onde conhece Sharkboy (Taylor Lautner), um garoto metade tubarão e metade humano que foi criado por tubarões após se perder no mar, e Lavagirl (Taylor Dooley), uma jovem vulcânica que lança chamas e pedras incandescentes.","first_air_date":"2005-06-10","runtime":92,"episode_run_time":[92],"vote_average":5.2,"created_by":["Troublemaker Studios"],"production_companies":[{"name":"Troublemaker Studios"}],"cast":["Taylor Lautner","Taylor Dooley","Cayden Boyd","David Arquette","Kristin Davis"],"backdrop_path":"https://image.tmdb.org/t/p/original/4ZOr50be8XntKw5Eq5n9HmRspNX.jpg","poster_path":"https://image.tmdb.org/t/p/original/6WUV2wPCFDX2LRQY5Iv6ElxdDe6.jpg","certification":"L","genres":["Aventura","Família","Ficção científica"],"trailer":"N/A"},
"22894":{"id":"22894","name":"Legião","slug":"legiao","original_title":"Legion","overview":"Deus perdeu a fé na humanidade e enviou o anjo Michael (Paul Bettany), juntamente com uma legião de anjos, para dar início ao apocalipse. Entretanto, ao chegar Michael resolve se opor às ordens recebidas e proteger os humanos. O palco da batalha será no interior dos Estados Unidos, onde fica uma lanchonete gerenciada por Bob Hanson (Dennis Quaid) e seu filho Jeep (Lucas Black). Juntamente com Charlie (Adrianne Palicki), uma garçonete grávida, e Percy Walker (Charles S. Dutton), eles precisam encontrar um meio para sobreviver aos anjos que desejam exterminá-los a todo custo.","first_air_date":"2010-01-21","runtime":100,"episode_run_time":[100],"vote_average":5.9,"created_by":["Screen Gems","Bold Films"],"production_companies":[{"name":"Screen Gems"},{"name":"Bold Films"}],"cast":["Paul Bettany","Dennis Quaid","Lucas Black","Kate Walsh","Tyrese Gibson"],"backdrop_path":"https://image.tmdb.org/t/p/original/8kJflsQ4SU9CJQFnht9mpXDW2cF.jpg","poster_path":"https://image.tmdb.org/t/p/original/4w83G68shLcuFcHaWfdPxPu1pUA.jpg","certification":"14","genres":["Terror","Ação","Fantasia"],"trailer":"N/A"},
