"399402":{"id":"399402","name":"Fúria em Alto Mar","slug":"furia-em-alto-mar","original_title":"Hunter Killer","overview":"Dono de métodos próprios nada convencionais, o Comandante Joe Glass é o responsável por liderar uma delicada missão pelas perigosas águas do Mar de Barents à bordo do submarino USS Arkansas. O objetivo da tarefa é monitorar a atividade militar russa na região após outro submarino americano desaparecer naqueles mares. Enquanto isso, a situação política na região se acirra ao ponto de Glass ter de tomar decisões cruciais para impedir que se deflagre um conflito de escala continental entre as duas potências.","first_air_date":"2018-10-19","runtime":118,"episode_run_time":[118],"vote_average":6.9,"created_by":["Original Film","G-BASE","Millennium Media","Hunter Killer Productions","SprocketHeads","Tucker Tooley Entertainment","Lionsgate","Davis Films","Summit Entertainment","Relativity Media"],"production_companies":[{"name":"Original Film"},{"name":"G-BASE"},{"name":"Millennium Media"},{"name":"Hunter Killer Productions"},{"name":"SprocketHeads"},{"name":"Tucker Tooley Entertainment"},{"name":"Lionsgate"},{"name":"Davis Films"},{"name":"Summit Entertainment"},{"name":"Relativity Media"}],"cast":["Gerard Butler","Gary Oldman","Toby Stephens","Common","Linda Cardellini"],"backdrop_path":"https://image.tmdb.org/t/p/original/gCIB3DdK00DyfwosVGf7pnFFdK3.jpg","poster_path":"https://image.tmdb.org/t/p/original/ral7cnZBQZGFmGaJUxrpcY8Xj3l.jpg","certification":"14","genres":["Ação","Aventura","Thriller"],"trailer":"N/A"},
