"2642":{"id":"2642","name":"Amor à Segunda Vista","slug":"amor-a-segunda-vista","original_title":"Two Weeks Notice","overview":"O milionário George Wade não dá um passo sem Lucy Kelson. Na teoria, ela deveria chefiar o setor jurídico da empresa de George, a Wade Corporation. Na prática, porém, a brilhante advogada graduada em Harvard é obrigada a opinar sobre cores de gravata e até mesmo as namoradas do patrão. Mas paciência tem limite, e cinco anos são suficientes: Lucy dá o aviso prévio. Finalmente livre de George e de suas exigências, a advogada está pronta para mudar de vida. Ou será que não? Conseguirá George decidir seu próprio destino sozinho pela primeira vez em cinco anos? Será tarde demais para dizer \"Eu te amo\"?","first_air_date":"2002-12-19","runtime":100,"episode_run_time":[100],"vote_average":6.4,"created_by":["Fortis Films","Castle Rock Entertainment","Village Roadshow Pictures","NPV Entertainment"],"production_companies":[{"name":"Fortis Films"},{"name":"Castle Rock Entertainment"},{"name":"Village Roadshow Pictures"},{"name":"NPV Entertainment"}],"cast":["Sandra Bullock","Hugh Grant","Dana Ivey","Robert Klein","Alicia Witt"],"backdrop_path":"https://image.tmdb.org/t/p/original/owRq5hVmyLv8pNx3Kn1dmE6AQOm.jpg","poster_path":"https://image.tmdb.org/t/p/original/8ilGwKirJdmlWyzCv6P7wxgh6Za.jpg","certification":"L","genres":["Romance","Comédia"],"trailer":"N/A"},
