"4148":{"id":"4148","name":"Foi Apenas Um Sonho","slug":"foi-apenas-um-sonho","original_title":"Revolutionary Road","overview":"April (Kate Winslet) e Frank Wheeler (Leonardo DiCaprio) são um casal jovem que vive no subúrbio de Connecticut com seus dois filhos na década de 1950. A máscara da auto segurança esconde a enorme frustração que sentem por não serem completos em seu relacionamento ou na carreira. Determinados a conhecerem a si mesmos, eles decidem se mudar para a França. Mas o relacionamento começa a corroer em um ciclo infinito de brigas, ciúmes e recriminações, e a viagem e seus sonhos correm grandes riscos de acabar.","first_air_date":"2008-12-19","runtime":119,"episode_run_time":[119],"vote_average":7.0,"created_by":["DreamWorks Pictures","BBC Film","Evamere Entertainment","Neal Street Productions"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"BBC Film"},{"name":"Evamere Entertainment"},{"name":"Neal Street Productions"}],"cast":["Leonardo DiCaprio","Kate Winslet","Kathy Bates","Michael Shannon","Kathryn Hahn"],"backdrop_path":"https://image.tmdb.org/t/p/original/ra9aXj8PpUbUHwwTRSl5zsL6WHM.jpg","poster_path":"https://image.tmdb.org/t/p/original/4YVRilZ1AvhUOSzaqeIrG9QYuD0.jpg","certification":"16","genres":["Drama","Romance"],"trailer":"N/A"},
