"818":{"id":"818","name":"Austin Powers: O Homem do Membro de Ouro","slug":"austin-powers-o-homem-do-membro-de-ouro","original_title":"Austin Powers in Goldmember","overview":"Dr. Evil e seu comparsa conseguem escapar da penitenciária e, juntamente com Goldmember, elaboram mais um arrojado plano de dominação mundial, que envolve uma viagem no tempo e ainda o sequestro de Nigel Powers, pai de Austin e o mais renomado espião de todos os tempos. Austin também viaja no tempo para deter os planos do trio de vilões, reencontrando em 1975 uma antiga namorada, Foxxy Cleopatra. Juntos, Austin e Foxxy devem salvar Nigel e impedir Dr. Evil e Goldmember de dominarem o mundo.","first_air_date":"2002-07-26","runtime":94,"episode_run_time":[94],"vote_average":6.0,"created_by":["Eric's Boy","New Line Cinema","Team Todd","Gratitude International","Moving Pictures"],"production_companies":[{"name":"Eric's Boy"},{"name":"New Line Cinema"},{"name":"Team Todd"},{"name":"Gratitude International"},{"name":"Moving Pictures"}],"cast":["Mike Myers","Beyoncé","Seth Green","Michael York","Robert Wagner"],"backdrop_path":"https://image.tmdb.org/t/p/original/kuPpElzfYnzsCye0hF8EbJSrvwo.jpg","poster_path":"https://image.tmdb.org/t/p/original/ewPHUg93snoYIg83c1CJn9WePbf.jpg","certification":"12","genres":["Comédia","Crime","Ficção científica"],"trailer":"N/A"},
