"503":{"id":"503","name":"Poseidon","slug":"poseidon","original_title":"Poseidon","overview":"Uma onda gigantesca faz com que um luxuoso transatlântico, chamado Poseidon, tombe e fique de cabeça para baixo em alto mar. Poucos são os sobreviventes, que precisam se unir. O capitão Michael Bradford (Andre Braugher) sugere que todos aguardem por socorro no local em que estão, mas John Dylan (Josh Lucas), um jogador profissional, prefere buscar um lugar que lhe dê maior segurança. A atitude de Dylan atrai outros sobreviventes, que decidem segui-lo. Entre eles está Robert Ramsey (Kurt Russell), que está desesperado por não conseguir encontrar sua filha, Jennifer (Emmy Rossum), e o noivo dela, Christian (Mike Vogel). Também se juntam a eles Maggie James (Jacinda Barrett) e seu filho Conor (Jimmy Bennett), a passageira clandestina Elena Gonzalez (Mia Maestro) e Richard Nelson (Richard Dreyfuss), um homem que embarcou no navio em dúvida se queria viver. Desperados em encontrar uma saída, o grupo se embrenha no aço retorcido enquanto o navio cada vez mais vai se enchendo de água.","first_air_date":"2006-05-03","runtime":98,"episode_run_time":[98],"vote_average":5.9,"created_by":["Virtual Studios","Radiant Productions","Next Entertainment","Irwin Allen Productions","Synthesis Entertainment","Warner Bros. Pictures"],"production_companies":[{"name":"Virtual Studios"},{"name":"Radiant Productions"},{"name":"Next Entertainment"},{"name":"Irwin Allen Productions"},{"name":"Synthesis Entertainment"},{"name":"Warner Bros. Pictures"}],"cast":["Josh Lucas","Kurt Russell","Jacinda Barrett","Richard Dreyfuss","Emmy Rossum"],"backdrop_path":"https://image.tmdb.org/t/p/original/r1gEZd7BoXtLNEQSNMqfsMlMtIz.jpg","poster_path":"https://image.tmdb.org/t/p/original/1ma5b9XLCziCHzQP0Zy1Y1PqNyM.jpg","certification":"12","genres":["Aventura","Ação","Drama","Thriller"],"trailer":"N/A"},
