"36586":{"id":"36586","name":"Blade II: O Caçador de Vampiros","slug":"blade-ii-o-cacador-de-vampiros","original_title":"Blade II","overview":"Blade é um ser meio homem, meio vampiro que é consumido pelo desejo de vingança contra os seres que atacaram sua mãe antes mesmo dele nascer e fizeram com que ele se tornasse o que é atualmente. Com isso, ao crescer Blade iniciou uma verdadeira cruzada pessoal para combater e eliminar os vampiros, mas agora uma nova raça mais poderosa chamada reapers, criada a partir de cruzamentos genéticos entre humanos e vampiros, ameaça eliminar ambas as raças. Visto isso, Blade se alia aos seus maiores inimigos para que, juntos, possam combater esta nova raça de seres.","first_air_date":"2002-03-22","runtime":117,"episode_run_time":[117],"vote_average":6.6,"created_by":["New Line Cinema","Amen Ra Films","Imaginary Forces"],"production_companies":[{"name":"New Line Cinema"},{"name":"Amen Ra Films"},{"name":"Imaginary Forces"}],"cast":["Wesley Snipes","Kris Kristofferson","Ron Perlman","Leonor Varela","Norman Reedus"],"backdrop_path":"https://image.tmdb.org/t/p/original/ftVcl83v6RlH0yiK1Ubkw70VwIf.jpg","poster_path":"https://image.tmdb.org/t/p/original/85FiSIRQpKyzNFqzUAe9RmPOdYY.jpg","certification":"14","genres":["Fantasia","Terror","Ação","Thriller"],"trailer":"N/A"},
