"227306":{"id":"227306","name":"Invencível","slug":"invencivel","original_title":"Unbroken","overview":"O filme conta a história de Louis Zamperini, uma estrela da pista olímpica e um herói da Segunda Guerra Mundial, que durante uma missão militar, sofreu um acidente de avião no Oceano Pacífico, do qual sobreviveu junto com dois companheiros. Ele E mais um sobrevivem. Eles passaram 47 dias à deriva numa balsa, quando foram encontrados por um navio de guerra japonês. Que os fizeram de prisioneiros e os levaram para uma ilha onde foram torturados e mantidos como prisioneiros de guerra por dois anos.","first_air_date":"2014-12-25","runtime":137,"episode_run_time":[137],"vote_average":7.4,"created_by":["Legendary Pictures","Jolie Pas","3 Arts Entertainment"],"production_companies":[{"name":"Legendary Pictures"},{"name":"Jolie Pas"},{"name":"3 Arts Entertainment"}],"cast":["Jack O'Connell","Alex Russell","Domhnall Gleeson","Garrett Hedlund","MIYAVI"],"backdrop_path":"https://image.tmdb.org/t/p/original/3sRj3VnrSUYhp6j1V43LXgKKdux.jpg","poster_path":"https://image.tmdb.org/t/p/original/4ewpP8s2PBOvsxQN9waaMWPCniy.jpg","certification":"14","genres":["Drama","Guerra"],"trailer":"N/A"},
