"10734":{"id":"10734","name":"Alcatraz: Fuga Impossível","slug":"alcatraz-fuga-impossivel","original_title":"Escape from Alcatraz","overview":"São Francisco, 1960. Frank Morris é um condenado que tem várias tentativas de fugas em seu histórico. Ele é enviado para Alcatraz, uma prisão de segurança máxima que também é conhecida como A Rocha e que fica em uma ilha, sendo que quem tentou escapar de lá ou foi recapturado ou morreu afogado. Frank vê gradativamente os pontos vulneráveis de Alcatraz e, com a ajuda de alguns outros internos, tenta pacientemente criar um rota de fuga.","first_air_date":"1979-06-22","runtime":113,"episode_run_time":[113],"vote_average":7.5,"created_by":["Paramount Pictures","Malpaso Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Malpaso Productions"}],"cast":["Clint Eastwood","Patrick McGoohan","Roberts Blossom","Jack Thibeau","Fred Ward"],"backdrop_path":"https://image.tmdb.org/t/p/original/lfLVH3F8Xt8nITqG9cn97b54au1.jpg","poster_path":"https://image.tmdb.org/t/p/original/hxmqEhjMIC5OPc6uQVGHhArWNSV.jpg","certification":"12","genres":["Drama","Thriller"],"trailer":"sWMwU1z0WcM"},
