"511987":{"id":"511987","name":"Predadores Assassinos","slug":"predadores-assassinos","original_title":"Crawl","overview":"Quando a Flórida é vítima de um imenso furacão, os tsnunamis levam todos os habitantes a evacuarem o local. Mesmo assim, a jovem Haley se recusa a sair de casa enquanto não conseguir resgatar o pai, gravemente ferido. Aos poucos, o nível da água começa a subir, Haley também se fere e tanto ela quanto o pai precisam enfrentar inimigos inesperados: gigantescos crocodilos que chegam com as águas.","first_air_date":"2019-07-11","runtime":88,"episode_run_time":[88],"vote_average":6.3,"created_by":["Raimi Productions","Fire Axe Pictures","Serbia Creates Film","Paramount Pictures"],"production_companies":[{"name":"Raimi Productions"},{"name":"Fire Axe Pictures"},{"name":"Serbia Creates Film"},{"name":"Paramount Pictures"}],"cast":["Kaya Scodelario","Barry Pepper","Morfydd Clark","Ross Anderson","Jose Palma"],"backdrop_path":"https://image.tmdb.org/t/p/original/lm4xH0YwFbVvTgdtau1thNK5S6J.jpg","poster_path":"https://image.tmdb.org/t/p/original/zjy40Ia8RusC6tKxOSkx32071oi.jpg","certification":"16","genres":["Terror","Thriller","Ação"],"trailer":"dmyrZsxqbQ4"},
