"1443":{"id":"1443","name":"As Virgens Suicidas","slug":"as-virgens-suicidas","original_title":"The Virgin Suicides","overview":"Cinco irmãs sonhadoras, as Lisbon, moram em uma casa simples de subúrbio em uma rua cheia de árvores, em meados dos anos 70 nos Estados Unidos. Seus destinos são marcados visivelmente pela vizinhança cheia de meninos, que ainda hoje continuam obcecados por elas. A vida das irmãs é marcada de amor e repressão, fantasia e terror, sexo e morte, memória e desejo. Esta é, na sua essência, uma história de mistério, que muda a vida de segredos dos adolescentes americanos.","first_air_date":"2000-04-21","runtime":97,"episode_run_time":[97],"vote_average":7.1,"created_by":["American Zoetrope","Muse Productions","Eternity Pictures"],"production_companies":[{"name":"American Zoetrope"},{"name":"Muse Productions"},{"name":"Eternity Pictures"}],"cast":["James Woods","Kathleen Turner","Kirsten Dunst","Josh Hartnett","Michael Paré"],"backdrop_path":"https://image.tmdb.org/t/p/original/6b6UpsOXmjO8mJKYsGTG9HW49CN.jpg","poster_path":"https://image.tmdb.org/t/p/original/aqiLCE1DN61gXKJrmAOZftw1fqg.jpg","certification":"16","genres":["Drama"],"trailer":"N/A"},
