"462":{"id":"462","name":"Erin Brockovich: Uma Mulher de Talento","slug":"erin-brockovich-uma-mulher-de-talento","original_title":"Erin Brockovich","overview":"Uma mulher de verdade. Uma história real. Uma vitória de fato. Julia Roberts estrela como Erin Brockovich, uma decidida e jovem mãe que luta por justiça de todas as maneiras que conhece. Desesperada por um trabalho que sustente suas três crianças, ela convence o advogado Ed Masry a contratá-la e descobre espontaneamente um caso legal contra uma corporação gigante. Agora, Erin está determinada a encarar uma luta contra um poderoso adversário que nenhuma firma de advocacia havia ousado antes. E, diferente do patrão, Erin nunca espera um \"não\" como resposta. Assim os dois começam uma luta difícil e hilariante que irá pôr uma cidadezinha a seus pés e uma grande companhia de joelhos.","first_air_date":"2000-03-17","runtime":131,"episode_run_time":[131],"vote_average":7.4,"created_by":["Jersey Films"],"production_companies":[{"name":"Jersey Films"}],"cast":["Julia Roberts","Albert Finney","Aaron Eckhart","Marg Helgenberger","Cherry Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/3HmLKhahTxX2ALTWlagr92pZrU7.jpg","poster_path":"https://image.tmdb.org/t/p/original/xX9QIj2dgfQVCq2C4VdEubfGJHI.jpg","certification":"14","genres":["Drama"],"trailer":"N/A"},
"522681":{"id":"522681","name":"Escape Room","slug":"escape-room","original_title":"Escape Room","overview":"Um intrigante convite reúne seis desconhecidos. A princípio, eles pensam que foram convidados a participar de um escape room imersivo, mas logo descobrem que não passam de joguetes de um jogo sádico de vida e morte. Juntos, passam de um cenário assustador para outro conforme vão encontrando pistas e resolvendo quebra-cabeças. No entanto, logo os jogadores descobrem que revelar seus segredos mais obscuros pode ser a chave para a sobrevivência.","first_air_date":"2019-01-03","runtime":100,"episode_run_time":[100],"vote_average":6.5,"created_by":["Columbia Pictures","Original Film"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Original Film"}],"cast":["Taylor Russell","Logan Miller","Jay Ellis","Deborah Ann Woll","Nik Dodani"],"backdrop_path":"https://image.tmdb.org/t/p/original/mWLljCmpqlcYQh7uh51BBMwCZwN.jpg","poster_path":"https://image.tmdb.org/t/p/original/pHZPHngiO8hG78wAmAzMWcIrKdW.jpg","certification":"14","genres":["Terror","Thriller","Mistério"],"trailer":"3ofTbmcHhj8"},
