"19186":{"id":"19186","name":"O Grande Amor de Nossas Vidas","slug":"o-grande-amor-de-nossas-vidas","original_title":"The Parent Trap","overview":"Hayley Mills interpreta gêmeas que, desconhecendo que seus pais se divorciaram, se encontram em um acampamento de verão. Como ambas moram com pai/mãe \"solteiros\", elas trocam de lugar (surpresa!) de modo a satisfazer a curiosidade de conhecer o pai/mãe que nunca conheceu. Claro que depois resolvem providenciar a re-união dos pais.","first_air_date":"1961-05-13","runtime":129,"episode_run_time":[129],"vote_average":7.0,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Hayley Mills","Maureen O'Hara","Brian Keith","Charles Ruggles","Cathleen Nesbitt"],"backdrop_path":"https://image.tmdb.org/t/p/original/wl7imDwEkYt1HnlsdEcUDXuxnRw.jpg","poster_path":"https://image.tmdb.org/t/p/original/eN7c9my5w2FCLGEIPIibOxZdQtD.jpg","certification":"e Livre","genres":["Comédia","Família"],"trailer":"N/A"},
