"13223":{"id":"13223","name":"Gran Torino","slug":"gran-torino","original_title":"Gran Torino","overview":"Walt Kowalski é um inflexível veterano da Guerra da Coréia, agora aposentado. Para passar o tempo ele faz consertos, bebe cerveja e vai mensalmente ao barbeiro. Sua vida é alterada quando passa a ter como vizinhos imigrantes hmong, vindos do Laos. Ressentido e desconfiando de todos, Walt apenas deseja passar o tempo que lhe resta de vida. Até que Thao, seu tímido vizinho adolescente, é obrigado por uma gangue a roubar o carro do veterano, um Gran Torino retirado da linha de montagem pelo próprio.","first_air_date":"2008-12-12","runtime":116,"episode_run_time":[116],"vote_average":8.0,"created_by":["Matten Productions","Double Nickel Entertainment","Gerber Pictures","Malpaso Productions","Village Roadshow Pictures","WV Films IV","Warner Bros. Pictures"],"production_companies":[{"name":"Matten Productions"},{"name":"Double Nickel Entertainment"},{"name":"Gerber Pictures"},{"name":"Malpaso Productions"},{"name":"Village Roadshow Pictures"},{"name":"WV Films IV"},{"name":"Warner Bros. Pictures"}],"cast":["Clint Eastwood","Christopher Carley","Bee Vang","Ahney Her","Brian Haley"],"backdrop_path":"https://image.tmdb.org/t/p/original/wmsePXV2z1b6ecXuKKrFbG0Q92P.jpg","poster_path":"https://image.tmdb.org/t/p/original/lnguNPnsaC4siq4TlzM2QEsTLsa.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"9273":{"id":"9273","name":"Ace Ventura 2: Um Maluco na África","slug":"ace-ventura-2-um-maluco-na-africa","original_title":"Ace Ventura: When Nature Calls","overview":"Depois de não conseguir salvar um guaxinim, Ace Ventura (Jim Carrey) impôs a si mesmo um exílio entre monges no Himalaia. Ele acaba deixando seu retiro espiritual para tentar encontrar o grande morcego branco sagrado, que foi prometido como dote a uma princesa de uma tribo africana. Caso o animal não seja recuperado em tempo hábil, uma guerra pode estourar entre tribos rivais.","first_air_date":"1995-11-10","runtime":94,"episode_run_time":[94],"vote_average":6.3,"created_by":["Morgan Creek Entertainment","Warner Bros. Pictures"],"production_companies":[{"name":"Morgan Creek Entertainment"},{"name":"Warner Bros. Pictures"}],"cast":["Jim Carrey","Ian McNeice","Simon Callow","Maynard Eziashi","Bob Gunton"],"backdrop_path":"https://image.tmdb.org/t/p/original/8JqXx6Tm6P4UEU8zAyC0A8R8bvz.jpg","poster_path":"https://image.tmdb.org/t/p/original/ai9kRyLHUIdmvWKHTl4NSi0Ghsw.jpg","certification":"L","genres":["Crime","Comédia","Aventura"],"trailer":"PzDjSjwnl1c"},
"873126":{"id":"873126","name":"Meu Nome é Vingança","slug":"meu-nome-e-vinganca","original_title":"Il mio nome è vendetta","overview":"Sofia era uma adolescente como qualquer outra, que gostava de dividir seu tempo livre entre partidas de hóquei e aulas de direção off-road — até o dia em que ela desobedece às ordens do pai e posta, em segredo, uma foto dele no Instagram. Mal sabia ela que aquele post mudaria as vidas deles para sempre. Seguindo as pistas no mundo online, dois criminosos conseguem encontrar a casa da família e acabam assassinando, a sangue frio, a mãe e o tio da jovem. A tragédia vai dar início a um acerto de contas que estava dormente por quase vinte anos.","first_air_date":"2022-11-30","runtime":90,"episode_run_time":[90],"vote_average":6.6,"created_by":["Colorado Film"],"production_companies":[{"name":"Colorado Film"}],"cast":["Alessandro Gassmann","Ginevra Francesconi","Remo Girone","Alessio Praticò","Francesco Villano"],"backdrop_path":"https://image.tmdb.org/t/p/original/edOt2jNyCbb8SQSvulD2sRRJhmA.jpg","poster_path":"https://image.tmdb.org/t/p/original/tlZGDi8anF7Fcs5HGVaTEMnv1hp.jpg","certification":"16","genres":["Ação","Crime","Aventura","Thriller"],"trailer":"N/A"},
"460555":{"id":"460555","name":"Sequestro no Mar Vermelho","slug":"sequestro-no-mar-vermelho","original_title":"红海行动","overview":"Durante uma operação de rotina no Mar Vermelho, a P.L.A. Navy (Peoples Liberation Army) Chinesa é avisada de que um navio foi sequestrado por piratas locais, onde turistas e marinheiros chineses foram feitos reféns. Enquanto as frotas principais e fortemente armadas não cheguem, um grupo de marinheiros menos preparados precisa tomar o controle da situação e iniciar o resgate dos passageiros, no entanto, a operação improvisada não sai como o esperado e uma terrível batalha sangrenta é iniciada em alto mar e em terra.","first_air_date":"2018-02-16","runtime":138,"episode_run_time":[138],"vote_average":7.4,"created_by":["Bona Film Group","The P.L.A Navy Government TV Art Central of China","Star Dream Studio Media","Emperor Film Production","Film Fireworks Production","Zak Productions","Emperor Motion Pictures","Huaxia Film Distribution","Sun Entertainment Culture","Tao Piao Piao","China Film Co-Production Corp."],"production_companies":[{"name":"Bona Film Group"},{"name":"The P.L.A Navy Government TV Art Central of China"},{"name":"Star Dream Studio Media"},{"name":"Emperor Film Production"},{"name":"Film Fireworks Production"},{"name":"Zak Productions"},{"name":"Emperor Motion Pictures"},{"name":"Huaxia Film Distribution"},{"name":"Sun Entertainment Culture"},{"name":"Tao Piao Piao"},{"name":"China Film Co-Production Corp."}],"cast":["Zhang Yi","黃景瑜","Hai Qing","Du Jiang","Zhang Hanyu"],"backdrop_path":"https://image.tmdb.org/t/p/original/uQNB6ccHv4uR21643xqyhK5Dk6W.jpg","poster_path":"https://image.tmdb.org/t/p/original/9MpJdI5c21JodrjMM5w3yBV76k5.jpg","certification":"N/A","genres":["Ação","Thriller","Guerra","Aventura"],"trailer":"N/A"},
"9874":{"id":"9874","name":"Stallone: Cobra","slug":"stallone-cobra","original_title":"Cobra","overview":"O tenente Marion \"Cobra\" Cobretti está no centro de uma série de assassinatos cometidos por uma sociedade secreta chamada Nova Ordem, em que os assassinos escolhem os membros mais fracos da sociedade para o extermínio. Com o número de homicídios aumentando, Cobra mantém a modelo Ingrid em custódia depois que ela testemunha contra o líder da Nova Ordem. Cobra se apaixona por Ingrid e eles encontram abrigo em uma pequena cidade, mas logo precisam lutar pela sobrevivência.","first_air_date":"1986-01-01","runtime":87,"episode_run_time":[87],"vote_average":6.1,"created_by":["The Cannon Group","Warner Bros. Pictures","Golan-Globus Productions"],"production_companies":[{"name":"The Cannon Group"},{"name":"Warner Bros. Pictures"},{"name":"Golan-Globus Productions"}],"cast":["Sylvester Stallone","Gitte Nielsen","Reni Santoni","Brian Thompson","Lee Garlington"],"backdrop_path":"https://image.tmdb.org/t/p/original/zPDpHMdbbE4O0TxVkMcgD6j2ImR.jpg","poster_path":"https://image.tmdb.org/t/p/original/hq95vDBwjw7zL1IRuIF7MluunOa.jpg","certification":"14","genres":["Ação","Crime","Thriller"],"trailer":"N/A"},
