"1685":{"id":"1685","name":"De Volta ao Planeta dos Macacos","slug":"de-volta-ao-planeta-dos-macacos","original_title":"Beneath the Planet of the Apes","overview":"Tentando resgatar Taylor, que desapareceu na missão anterior, Brent um outro astronauta, atravessa uma fenda do tempo e chega até 3955 D.C. Porém sua nave se espatifa no mesmo planeta em que Taylor desapareceu. Ao ir para a Zona Proibida, Brent gradativamente vê que aquilo são os escombros de Nova York. Paralelamente os símios resolvem atacar a Zona Proibida, que Brent ao explorar descobre uma raça de mutantes, que se comunicam telepaticamente e que adoram uma bomba atômica, que é capaz de destruir a Terra inteira.","first_air_date":"1970-04-23","runtime":94,"episode_run_time":[94],"vote_average":6.2,"created_by":["APJAC Productions","20th Century Fox"],"production_companies":[{"name":"APJAC Productions"},{"name":"20th Century Fox"}],"cast":["James Franciscus","Kim Hunter","Maurice Evans","Charlton Heston","Linda Harrison"],"backdrop_path":"https://image.tmdb.org/t/p/original/e5MlN03JvbpTqq2dsW3H2VUTU4s.jpg","poster_path":"https://image.tmdb.org/t/p/original/hF8pbEph4cRTte6wprju5Vea1m1.jpg","certification":"L","genres":["Aventura","Ficção científica","Mistério"],"trailer":"N/A"},
