"168":{"id":"168","name":"Jornada nas Estrelas IV: A Volta para Casa","slug":"jornada-nas-estrelas-iv-a-volta-para-casa","original_title":"Star Trek IV: The Voyage Home","overview":"Marcados como fugitivos pela própria Federação que juraram proteger, os tripulantes da Enterprise voltam para a Terra para enfrentar a corte marcial por crimes cometidos ao salvar a vida de Spock. Em seu caminho, contudo, descobrem que o planeta está sendo devastado por uma gigantesca sonda alienígena, que exige uma resposta de uma forma de vida há muito extinta da Terra. Dentro da nave klingon capturada, Kirk e sua tripulação devem voltar no tempo para salvar a Terra e redescobrir o sentido da amizade.","first_air_date":"1986-11-26","runtime":118,"episode_run_time":[118],"vote_average":7.1,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["William Shatner","Leonard Nimoy","DeForest Kelley","James Doohan","George Takei"],"backdrop_path":"https://image.tmdb.org/t/p/original/wN3dgwkiWSLrMVukPQIeccv5EJ6.jpg","poster_path":"https://image.tmdb.org/t/p/original/1QfHoXsGaMc1OgGcBoPNxcJ9WeI.jpg","certification":"N/A","genres":["Ficção científica","Aventura"],"trailer":"N/A"},
