"8913":{"id":"8913","name":"Cemitério Maldito","slug":"cemiterio-maldito","original_title":"Pet Sematary","overview":"Recentemente os Creeds se mudaram para uma nova casa nos arredores de Chicago. A casa é perfeita, exceto por duas coisas: Os reboques, que vivem fazendo barulho na estrada, e o misterioso cemitério no bosque atrás da casa. Os vizinhos dos Creeds estão relutantes em falar sobre o cemitério e eles tem um bom motivo para tal comportamento. Gradativamente o casal toma conhecimento da verdade e ficam chocados ao saberem do perigo que seus filhos correm. Quando o gato da família morre atropelado, eles o enterram em um cemitério indígena que tem o poder de ressuscitar o que for deixado naquele terreno, mas as consequências são inimagináveis.","first_air_date":"1989-04-21","runtime":103,"episode_run_time":[103],"vote_average":6.6,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Dale Midkiff","Fred Gwynne","Denise Crosby","Brad Greenquist","Michael Lombard"],"backdrop_path":"https://image.tmdb.org/t/p/original/xWq3T9P4NU2pTdZ3hXFygsNnAq4.jpg","poster_path":"https://image.tmdb.org/t/p/original/5sBCDm9sFRS2LmlvBH7381Q53Wm.jpg","certification":"16","genres":["Terror","Drama"],"trailer":"N/A"},
